import React from 'react'
import {createClass} from '../shared/utils/sharedFunctions'

function svgProps(props) {
  const {className, width = `24`, height = `24`} = props

  return {
    ...props,
    className: createClass(`feather`, {}, className),
    xmlns: `http://www.w3.org/2000/svg`,
    width,
    height,
    viewBox: `0 0 ${width} ${height}`
  }
}

const SvgRender = (props) => {
  if (!props.children) return null
  return <svg {...svgProps(props)}>{props.children}</svg>
}

